import axios from 'axios';


function App() {
  // const url  = `https://api.openweathermap.org/data/2.5/weather?q=toronto&appid=7cbe8fd0a0e569d6669b65ca30c71e97`
  return (
    <div className="app">
      <div className='container'>
        <div className='top'>
          <div className='location'> <p>Toronto</p> </div>
          <div className='temp'><h1>60˚F</h1></div>
          <div className='description'><p>Cloudy</p></div>
        </div>
        <div className='bottom'>
          <div className='feels'><p className='bold'>65˚F</p>
          <p>Feels Like</p></div>
          <div className='humidity'> <p>20%</p><p>Humidity</p>  </div>
          <div className='wind'>12 MPH <p>Wind Speed</p></div>
      </div>
    </div>
  </div>
  );
}

export default App;
